import { StyleSheet, Text, View } from 'react-native';
import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';
import Get from '../view/Admin/Get';
import Post from '../view/Admin/Post';
import Login from '../view/Login';
import DetailsScreen from '../view/DetailsScreen';
const Stack = createStackNavigator();
const AdminStack = ({navigate}) => {
    return (
        <Stack.Navigator screenOptions={{ header: () => null }}>
            <Stack.Screen name="Get" component={Get} options={({ navigation, route }) => ({
                title: 'CRUD Data User',
                headerRight: () => (
                    <Ionicons
                        name={'ios-add-circle'}
                        size={25}
                        color={'white'}
                        style={{ marginRight: 15 }}
                        onPress={() => navigation.navigate('Post')}
                    />
                ),
            })}
            />
            <Stack.Screen name="Detail" component={DetailsScreen} />
            <Stack.Screen name="Post" component={Post} />
            <Stack.Screen name="login" component={Login} />
        </Stack.Navigator>
    );
}

export default AdminStack

const styles = StyleSheet.create({})
